import React from "react";
import { Bar, Line, Pie } from "react-chartjs-2";
import { Chart as ChartJS, CategoryScale, LinearScale, BarElement, Title, Tooltip, Legend, PointElement, LineElement, ArcElement } from "chart.js";
import "./Visualization.css";

ChartJS.register(CategoryScale, LinearScale, BarElement, Title, Tooltip, Legend, PointElement, LineElement, ArcElement);

const Visualization = ({ processedData }) => {
  if (!processedData || processedData.length === 0) {
    return <p>No processed data available for visualization.</p>;
  }

  const labels = processedData.map((item, index) => `Row ${index + 1}`);
  const values = processedData.map((item) => item.value);

  const chartData = {
    labels,
    datasets: [{ label: "Processed Data", data: values, backgroundColor: "rgba(75, 192, 192, 0.6)" }],
  };

  return (
    <div className="visualization-container">
      <h2>Data Visualization</h2>
      <div className="chart-container">
        <Bar data={chartData} />
        <Line data={chartData} />
        <Pie data={chartData} />
      </div>
    </div>
  );
};

export default Visualization;
